import React from "react";
import styled from "styled-components";


import fbIcon from "../assets/images/icons/fb.png";
import ytIcon from "../assets/images/icons/yt.png";
import gmIcon from "../assets/images/icons/gm.png";

export default function Contacts() {
  return (
    <ContactsIcons>
      <a href="">
        <img src={fbIcon} alt="fbIcon" />
      </a>
      <a>
        <img src={ytIcon} alt="ytIcon" />
      </a>
      <a>
        <img src={gmIcon} alt="gmIcon" />
      </a>
    </ContactsIcons>
  );
}

const ContactsIcons = styled.div`
  display: flex;
  align-items: flex-end;
  justify-content: center;
  gap: 16px;
  position: sticky;
  top: 16px;
  height: 112px;
  z-index: 1;
  & img {
    width: 32px;
    padding-bottom: 16px;
  }
  @media screen and (max-width: 464px) {
    position: unset;
  }
`;
